INSERT INTO `wp_posts` VALUES (1,1,'2015-09-02 17:17:47','2015-09-02 17:17:47','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2015-09-02 17:17:47','2015-09-02 17:17:47','',0,'http://localhost/activehands/?p=1',0,'post','',1),(2,1,'2015-09-02 17:17:47','2015-09-02 17:17:47','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/activehands/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2015-09-02 17:17:47','2015-09-02 17:17:47','',0,'http://localhost/activehands/?page_id=2',0,'page','',0),(3,1,'2015-09-02 17:20:01','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2015-09-02 17:20:01','0000-00-00 00:00:00','',0,'http://localhost/activehands/?p=3',0,'post','',0),(4,1,'2015-09-02 17:37:41','2015-09-02 17:37:41','About us Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod\r\ntempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,\r\nquis nostrud exercitation ullamco laboris nisi